import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';

import { initializeContract } from './utils/near';

const root = ReactDOM.createRoot(document.getElementById('root'));
window.nearInitPromise = initializeContract()
  .then(() => {
    root.render(<App />);
  })
  .catch(console.error);
